script: |
  super -f text -I q10403.spq | sort > q10403.out

inputs:
  - name: q10403.spq
    data: |
      SELECT col2 + + col0 + - - CAST ( NULL AS INTEGER ) AS col2 FROM tab1 (FORMAT parquet) WHERE NULL NOT BETWEEN NULL AND col2 * - ( + 91 ) + + - col1;
  - name: tab1

outputs:
  - name: q10403.out
    data: |
